  assemblies:
  - EasyPost
  namespace: EasyPost.Services
  summary: "\nList all Insurance objects.\n"
  example: []
  syntax:
    content: public async Task<InsuranceCollection> All(Dictionary<string, object> parameters = null)
    parameters:
    - id: parameters
      type: System.Collections.Generic.Dictionary{System.String,System.Object}
      description: "\nOptional dictionary containing parameters to filter the list with. Valid pairs:\n* {&quot;before_id&quot;, string} String representing an Insurance ID. Starts with &quot;ins_&quot;. Only retrieve insurances created\nbefore this id. Takes precedence over after_id.\n* {&quot;after_id&quot;, string} String representing an Insurance ID. Starts with &quot;ins_&quot;. Only retrieve insurances created\nafter\nthis id.\n* {&quot;start_datetime&quot;, string} ISO 8601 datetime string. Only retrieve insurances created after this datetime.\n* {&quot;end_datetime&quot;, string} ISO 8601 datetime string. Only retrieve insurances created before this datetime.\n* {&quot;page_size&quot;, int} Max size of list. Default to 20.\nAll invalid keys will be ignored.\n"
    return:
      type: System.Threading.Tasks.Task{EasyPost.Models.API.InsuranceCollection}
      description: An EasyPost.InsuranceCollection instance.
